  const { getSingleHero, product } = useContext(ProductContext);
  const {
    id,
    name,
    appearance,
    className,
    biography,
    connections,
    image,
    powerstats,
    work,
  } = product;

  useEffect(() => {
    getSingleHero(match.params.id);
  }, []);

